import React from "react";
import "./Home.css";

function Home() {
  return (
    <div>
      <nav className="navbar navbar-expand-lg">
        <div className="collapse navbar-collapse justify-content-end">
          <ul className="navbar-nav">
            <li className="nav-item">
              <button className="btn icon-btn" onClick={() => alert("Login/Register process")}>
                <img src="images/icons/login/home-login-256.png" alt="Login/Register" className="icon-img" />
              </button>
            </li>
          </ul>
        </div>
      </nav>
      <div className="container">
        <h1>Welcome to the Invoice Management System</h1>
        <p>This is the home page. Please log in to access your account.</p>
      </div>
    </div>
  );
}

export default Home;
